import React from 'react';


const ApplicationRoommates = (props) => {

    const f0 = (event) => {
        const newApply = {...props.apply};
        newApply.preferedroommates = event.target.value;
        props.setApply(newApply);
    };


    const f1 = (event) => {
        const newApply = {...props.apply};
        newApply.gender = event.target.value;
        props.setApply(newApply);
    };

    const f2 = (event) => {
        const newApply = {...props.apply};
        newApply.roommategender = event.target.value;
        props.setApply(newApply);
    };

    const f3 = (event) => {
        const newApply = {...props.apply};
        newApply.smoker = event.target.value;
        props.setApply(newApply);
    };

    const f4 = (event) => {
        const newApply = {...props.apply};
        newApply.drinker = event.target.value;
        props.setApply(newApply);
    };

    const f5 = (event) => {
        const newApply = {...props.apply};
        newApply.comfortableanimal = event.target.value;
        props.setApply(newApply);
    };

    const f6 = (event) => {
        const newApply = {...props.apply};
        newApply.neat = event.target.value;
        props.setApply(newApply);
    };

    const f7 = (event) => {
        const newApply = {...props.apply};
        newApply.quite = event.target.value;
        props.setApply(newApply);
    };


    const f9 = (event) => {
        const newApply = {...props.apply};
        newApply.roommatedrinker = event.target.value;
        props.setApply(newApply);
    };

    const f10 = (event) => {
        const newApply = {...props.apply};
        newApply.animal = event.target.value;
        props.setApply(newApply);
    };



    return (
        <div>
            <h2 className="form section header">
                <span>
                    Roommate
                </span>
            </h2>

            <h3 className="form section header">
                <span>
                    INVITE ROOMMATES
                </span>
            </h3>

            <p>Do you have any roommates that you want to live with?</p>
            <input type="text" onChange={f0}/>


            <h3 className="form section header">
                <span>
                    INTERESTS
                </span>
            </h3>
            <p>The following questions will help us find your ideal room placement.</p>

            <h4>General</h4>

            <p>What is your gender?</p>
            <select
                value={props.gender}
                onChange={f1}
            >
                <option value=""></option>
                <option value="Male">Male</option>
                <option value="Female">Female</option>
            </select>
a

            <p>Do you smoke?</p>
            <select
                value={props.smoker}
                onChange={f3}
            >
                <option value=""></option>
                <option value="Yes">Yes</option>
                <option value="No">No</option>
            </select>


            <p>Do you have a pet?</p>
            <select
                value={props.animal}
                onChange={f10}
            >
                <option value=""></option>
                <option value="Yes">Yes</option>
                <option value="No">No</option>
            </select>



            <h4>Personality</h4>
            <p>What gender of roommate (s) do you want to live with?</p>
            <select
                value={props.roommategender}
                onChange={f2}
            >
                <option value=""></option>
                <option value="I don't mind">I don't mind</option>
                <option value="Male">Male</option>
                <option value="Female">Female</option>
            </select>


            <p>Do you mind your roommate drinking?</p>
            <select
                value={props.roommatedrinker}
                onChange={f9}
            >
                <option value=""></option>
                <option value="Yes">Yes</option>
                <option value="No">No</option>
            </select>

            <p>Are you comfortable living with an animal? *</p>
            <select
                value={props.comfortableanimal}
                onChange={f5}
            >
                <option value=""></option>
                <option value="Yes">Yes</option>
                <option value="No">No</option>
            </select>

            <p>Do you consider yourself neat?</p>
            <select
                value={props.neat}
                onChange={f6}
            >
                <option value=""></option>
                <option value="Very neat">Very neat</option>
                <option value="Average neat">Average neat</option>
                <option value="Messy">Messy</option>
            </select>

            <p>Do you consider yourself quite?</p>
            <select
                value={props.quite}
                onChange={f7}
            >
                <option value=""></option>
                <option value="vq">Very quite</option>
                <option value="aq">Average quite</option>
                <option value="noisy">Noisy</option>
            </select>

        </div>

    )

}
export default ApplicationRoommates;
